import React from 'react';
import './navigation.css';
import logo from './logo.png';

const Navigation =({onRouteChange, isSignedIn}) => {
    if(isSignedIn){
        return(
            <nav className="navbar main-nav">
                <a className="navbar-brand" href="#0">
                    <img src={logo} width="40" height="40" alt="logo" loading="lazy" />
                </a>
                <a  onClick={()=>onRouteChange('signin')} href="#0" className='btn btn-outline-light ml-auto my-2 my-sm-0'>Sign Out</a>
            </nav>
        );
            
        }else {
            return (
                <nav className="navbar navbar-expand navbar-dark flex-column flex-md-row bd-navbar">
                    <a className="navbar-brand mr-0 mr-md-2" href="#0">
                        <img className="d-block" src={logo} width="36" height="36" alt="logo" loading="lazy" />
                    </a>
                    <ul className="navbar-nav ml-md-auto my-2">
                        <li  onClick={()=>onRouteChange('home')} className='  nav-item'>Register</li>
                        <li  onClick={()=>onRouteChange('home')} href="#0" className='nav-item'>Sign In</li>
                    </ul>
                    
                </nav>
            );
            
        }
    
}

export default Navigation;
